import React from 'react';
import { Link } from 'react-router-dom'

interface ListItemProps {
  note: { id: number; body: string };
}

const ListItem: React.FC<ListItemProps> = ({ note }) => {
  return (
    <Link to={`note/${note.id}`}>
      <h3>{note.body}</h3>
    </Link>
  );
};

export default ListItem;
